import axios from "axios"
let token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyOWU2OGE2MDA4ZmY3NGM0N2VkYjUxMCIsImlhdCI6MTY1NDU0ODY0NywiZXhwIjoxNjU0NjM1MDQ3fQ.g9hITy0OZgl5bxoh8S5UsxyJLlhjn1PT_qkfonjmVAo"
export const getCuentasRequest = async () => {
    await axios.get("/cuentas",{ headers: {"x-access-token" : `${token}`} })
}
